function loadmoreDataOnScroll() {
    try {
        $("#mostNew").bind("scroll", function () {
            if (($("#mostNew").prop('scrollHeight') - $("#mostNew").height()) == $("#mostNew").prop('scrollTop')) {
                if (Math.ceil(parseFloat($("#totalrecord").val()) / parseFloat($("#pagesize").val())) >= parseInt($("#pageno").val()) + 1) {
                    $("#pageno").val(parseInt($("#pageno").val()) + 1)
                    if ($("#searchtype").val() != "3") {
                        GetLatestNews($("#searchtype").val(), 1, 1, 0, $("#pageno").val(), $("#pagesize").val());
                    } else {
                        GetLatestNews(3, fromdate, todate, 0, $("#pageno").val(), $("#pagesize").val());
                    }

                }
            }
        });
    } catch (e) {
    }
}

