function initializeCalender() {
    var dates = $("#Fromdatepicker, #Todatepicker").datepicker({
        numberOfMonths: 1, showButtonPanel: false, changeYear: false, changeMonth: true, //yearRange: '-0:+0',
        monthRange: '-0:+1', minDate: '-31', maxDate: '0', dateFormat: 'dd/mm/yy', onSelect: function (selectedDate) {
            var option = this.id == "Fromdatepicker" ? "minDate" : "maxDate", instance = $(this).data("datepicker"),
                date = $.datepicker.parseDate(instance.settings.dateFormat || $.datepicker._defaults.dateFormat, selectedDate, instance.settings);
            dates.not(this).datepicker("option", option, date);
        }
    });
    $(".hasDatepicker").bind("click", function () {
        if ($(".ui-datepicker").find(".wrapperSelectCal").length > 0) {
            return false;
        }
        $(".ui-datepicker-month").wrap("<div class='wrapperSelectCal' >");
        $(".ui-datepicker-month").attr("onchange", 'resetSelect()');
        if ($.browser.msie) {
            if (parseInt($.browser.version, 10) == 9) {
                $(".ui-datepicker .ui-datepicker-title select").attr("style", "font-size:1em !important;top:-5px;");
            }
        }


    });

}

function resetSelect() {
    $(".ui-datepicker-month").wrap("<div class='wrapperSelectCal' >");
    $(".ui-datepicker-month").attr("onchange", 'resetSelect()');
    if ($.browser.msie) {
        if (parseInt($.browser.version, 10) == 9) {
            $(".ui-datepicker .ui-datepicker-title select").attr("style", "font-size:1em !important;top:-5px;");
        }
    }
}

// Get Count For Countries
function ShowNewsMapCount(type, from, to, countryId, continentID, ArabWorld) {
    $("#map-canvas").append("<div class='loadingHolder mapLoading'><img class='imgloading' src='assets/images/loading.GIF'></div>");
    clearOverlays();
    $.ajax({
        // url: "/NewsMap/NewsMapCount/" + type + "/" + from + "/" + to + "/" + countryId + "/" + continentID + "/" + ArabWorld + "",
        url: locale + "/newsMapCount?type=" + type + "&from=" + from + "&to=" + to + "&countryId=" + countryId + "&continentID=" + continentID + "&ArabWorld=" + ArabWorld + "",
        type: 'GET',
        success: function (result) {
            if (result != '') {
                StaticMarkers = [];
                StaticGulfMarkers = [];
                $.each(result, function (i, item) {
                    if (!FillStaticMarkers(result[i])) {
                        if (!FillStaticGulfMarkers(result[i])) {
                            console.log('trace aa1a');
                            setMarkesr(result[i].CountryId, result[i].CountryName, result[i].latitude, result[i].longitude, result[i].TotalNews);
                        }
                    }
                });
                if (map.getZoom() > 2) {
                    clearOverlaysById_createdynamicmarkers();
                } else {
                    clearOverlaysById_CreateStaticMarker();
                }

                $("#map-canvas").find(".loadingHolder ").remove();
            } else {
                $("#map-canvas").find(".loadingHolder ").remove();
            }
        },
        error: function () {
            $("#map-canvas").find(".loadingHolder ").remove();
        }
    });

}

// push array for country
function FillStaticMarkers(result) {
    if (result.CountryId == "E4F82A05-805A-44A5-ACCC-775B4641EDF8" || result.CountryId == "684FB93D-A7DC-427F-9783-11E808951591" || result.CountryId == "616C1F29-F641-491D-ACE2-4CCE02168657" || result.CountryId == "96B07C17-F400-41D1-8CC4-99AD92C2B85B" || result.CountryId == "750CC971-AD74-4703-8017-D79C7C23A9BB") {
        StaticMarkers.push([result.CountryId, result.CountryName, result.latitude, result.longitude, result.TotalNews]);
        return true;
    } else {
        return false;
    }
}

// push array for country(Gulf)
function FillStaticGulfMarkers(result) {
    if (result.CountryId == "334298CD-78B8-47DD-A51E-C78A92A245EB" || result.CountryId == "CE619CD0-995A-4F9E-881D-6898C1399AD7" || result.CountryId == "53F0872E-3263-4ED6-9DDB-00935F2DFCA7" || result.CountryId == "7D165E85-4625-4C5E-A03E-ED26C26686E0") {
        StaticGulfMarkers.push([result.CountryId, result.CountryName, result.latitude, result.longitude, result.TotalNews]);
        return true;
    } else {
        return false;
    }
}

// Create Static Markers
function CreateStaticMarker() {
    try {
        var count = 0;
        if (StaticMarkers.length > 0) {
            for (var k = 0; k <= StaticMarkers.length - 1; k++) {
                count = count + parseInt(StaticMarkers[k][4]);
            }
            setMarkesr("1", "", "30.387092", "36.650391", count);

        }
    } catch (e) {
    }
}

