// Get List News For (All and By List Of Country--- Popup Data)
function GetListNewsByCountry(obj) {

    //loading image
    var type = $("#searchtype").val();
    var from = fromdate;
    var to = todate;
    var pagesize = $("#pagesize").val();
    var pageno = $("#pagenocountry").val();
    var countryId;
    if (obj.countryid == "1" || obj.countryid == "2") {
        countryId = $("#countryid").val();
    } else {
        countryId = obj.countryid;
    }

    $("#countryid").val(countryId);
    $("#map-canvas").append("<div class='loadingHolder mapLoading'><img class='imgloading' src='assets/images/loading.GIF'></div>");
    $.ajax({
        url: locale + "/latestNews/" + countryId + "?type=" + type + "&from=" + from + "&to=" + to + "&countryId=" + countryId + "&pageno=" + pageno + "&pagesize=" + pagesize + "",
        type: 'GET',
        success: function (result) {
            if (result != '') {
                $("#map-canvas").find(".loadingHolder ").remove();
                infowindow = new google.maps.InfoWindow({
                    content: result
                });
                infowindow.open(map, obj);
                setTimeout(function () {
                    $(".gm-style-iw").next("div").next("img").css("display", "none");
                    $(".gm-style-iw").next("div").css("display", "none");
                    popMapSroll();
                    fixFireFox();
                    hoverIpadCloseMap();
                    stayfocused();
                    clickedMarker = true;
                }, 400);
                if ($(".rotatedArr").length > 0) {
                    $(".rotatedArr").trigger("click");
                }
            } else {
                $("#map-canvas").find(".loadingHolder ").remove();
            }
        },
        error: function () {
            $("#map-canvas").find(".loadingHolder ").remove();
        }

    });
}

