// Highlight By country
function Highlightcountry(obj) {
    if (obj.countryid != '') {
        clearpolygon();
        regionCoords = getkmL(obj.countryid);
        Coords = new google.maps.Polygon({
            paths: [regionCoords],
            strokeColor: "#3333ff",
            strokeOpacity: 0.5,
            strokeWeight: 1,
            fillColor: "#3333ff",
            fillOpacity: 0.5
        });

        Coords.setMap(map);
    }
    //  var xloc = obj.position.lat();
    // map.setCenter(new google.maps.LatLng(obj.position.lat(), obj.position.lng()));
    map.setZoom(parseInt(4));
}

// Continent Zooming
function ContinentZoom(lat, lng, zoom) {
    map.setCenter(new google.maps.LatLng(lat, lng));
    map.setZoom(parseInt(zoom));
}

