/// <reference path="../typings/google.maps.d.ts" />
function FullScreenControl(map, enterFull, exitFull) {
    if ($(window).width() > 1025) {
        if (enterFull === void 0) {
            enterFull = null;
        }
        if (exitFull === void 0) {
            exitFull = null;
        }
        if (enterFull == null) {
            enterFull = "Full screen";
        }
        if (exitFull == null) {
            exitFull = "Exit full screen";
        }
        var controlDiv = document.createElement("div");
        controlDiv.className = "fullScreen";
        controlDiv.index = 1;
        controlDiv.style.padding = "5px";
        // Set CSS for the control border.
        var controlUI = document.createElement("div");
        controlUI.style.backgroundColor = "white";
        controlUI.style.borderStyle = "solid";
        controlUI.style.borderWidth = "1px";
        controlUI.style.borderColor = "#717b87";
        controlUI.style.cursor = "pointer";
        controlUI.style.textAlign = "center";
        controlUI.style.boxShadow = "rgba(0, 0, 0, 0.298039) 0px 1px 4px -1px";
        controlDiv.appendChild(controlUI);
        // Set CSS for the control interior.
        var controlText = document.createElement("div");
        controlText.style.fontFamily = "Roboto,Arial,sans-serif";
        controlText.style.fontSize = "11px";
        controlText.style.fontWeight = "400";
        controlText.style.paddingTop = "0px";
        controlText.style.paddingBottom = "0px";
        controlText.style.paddingLeft = "0px";
        controlText.style.paddingRight = "0px";
        controlText.innerHTML = "<strong class='ajaStyle' onclick='BigFilterMap();' >" + enterFull + "</strong>";
        controlUI.appendChild(controlText);
        // set print CSS so the control is hidden
        var head = document.getElementsByTagName("head")[0];
        var newStyle = document.createElement("style");
        newStyle.setAttribute("type", "text/css");
        newStyle.setAttribute("media", "print");
        var cssText = ".fullScreen { display: none;}";
        var texNode = document.createTextNode(cssText);
        try {
            newStyle.appendChild(texNode);
        } catch (e) {
            // IE8 hack
            newStyle.styleSheet.cssText = cssText;
        }
        head.appendChild(newStyle);
        var fullScreen = false;
        var interval;
        var mapDiv = map.getDiv();
        var divStyle = mapDiv.style;
        if (mapDiv.runtimeStyle) {
            divStyle = mapDiv.runtimeStyle;
        }
        var originalPos = divStyle.position;
        var originalWidth = divStyle.width;
        var originalHeight = divStyle.height;
        // IE8 hack
        if (originalWidth === "") {
            originalWidth = mapDiv.style.width;
        }
        if (originalHeight === "") {
            originalHeight = mapDiv.style.height;
        }
        var originalTop = divStyle.top;
        var originalLeft = divStyle.left;
        var originalZIndex = divStyle.zIndex;
        var bodyStyle = document.body.style;
        if (document.body.runtimeStyle) {
            bodyStyle = document.body.runtimeStyle;
        }
        var originalOverflow = bodyStyle.overflow;
        controlDiv.goFullScreen = function () {
            var center = map.getCenter();
            mapDiv.style.position = "fixed";
            mapDiv.style.width = "100%";
            mapDiv.style.height = "100%";
            mapDiv.style.top = "0";
            mapDiv.style.left = "0";
            mapDiv.style.zIndex = "2147483640";
            document.body.style.overflow = "hidden";
            controlText.innerHTML = "<strong class='ajaStyle' onclick='removeBigFilterMap();' >" + exitFull + "</strong>";
            fullScreen = true;
            google.maps.event.trigger(map, "resize");
            map.setCenter(center);
            // this works around street view causing the map to disappear, which is caused by Google Maps setting the
            // CSS position back to relative. There is no event triggered when Street View is shown hence the use of setInterval
            interval = setInterval(function () {
                if (mapDiv.style.position !== "fixed") {
                    mapDiv.style.position = "fixed";
                    google.maps.event.trigger(map, "resize");
                }
            }, 100);
        };
        controlDiv.exitFullScreen = function () {
            var center = map.getCenter();
            if (originalPos === "") {
                mapDiv.style.position = "relative";
            } else {
                mapDiv.style.position = originalPos;
            }
            mapDiv.style.width = originalWidth;
            mapDiv.style.height = originalHeight;
            mapDiv.style.top = originalTop;
            mapDiv.style.left = originalLeft;
            mapDiv.style.zIndex = originalZIndex;
            document.body.style.overflow = originalOverflow;
            controlText.innerHTML = "<strong class='ajaStyle' onclick='BigFilterMap();'>" + enterFull + "</strong>";
            fullScreen = false;
            google.maps.event.trigger(map, "resize");
            map.setCenter(center);
            clearInterval(interval);
        };
        // Setup the click event listener
        google.maps.event.addListener(controlUI, "click", function () {
            if (!fullScreen) {
                controlDiv.goFullScreen();
            } else {
                controlDiv.exitFullScreen();
            }
        });
        return controlDiv;
    }
}

function BigFilterMap() {
    if ($(window).width() > 1024) {
        $("#FilterHolder").addClass("bigMapFilter");
        $("#FilterHolder").append("<div class='pullBigFil' ></div>")
        $(".bigMapFilter").animate({right: -$(".bigMapFilter").width()});
        $("#encyclopedia_beta_label").fadeOut();
        if ($(window).width() == 768) {
            $(".wrapperSelect").hide()
        } else if ($(window).width() == 1024) {
            $(".wrapperSelect").css("display", "inline-block")
        }
        $(".pullBigFil").bind("click", function () {

            if ($(this).hasClass("pulledFil")) {
                $(".bigMapFilter").animate({right: -$(".bigMapFilter").width()});
                $(this).removeClass("pulledFil");
                $(".pullBigFil").removeClass("rotatedArr");
                if ($(window).width() == 768) {
                    $(".pullBigFil ").animate({left: "-20px"});
                    $(".wrapperSelect").removeAttr("style")
                    $(".pullBigFil ").removeClass("ipad768Width");
                    $("#mostNew").removeAttr("style");
                    $(".wrapperSelect").hide();
                }
            } else {
                $(".bigMapFilter").animate({right: 0});
                $(this).addClass("pulledFil");
                $(".pullBigFil").addClass("rotatedArr");
                if ($(window).width() == 768) {
                    $(".wrapperSelect").fadeIn();
                    $(".pulledFil").animate({left: "-164px"});
                    $("#mostNew").animate({width: "159.9%"});
                    $("#mostNew").css("background", "#fff");
                    $(".wrapperSelect").css("z-index", "1")
                    $(".pulledFil ").addClass("ipad768Width");

                }
            }

        });
    } else {
        $("#encyclopedia_beta_label").fadeOut();
    }
}


function removeBigFilterMap() {
    if ($(window).width() > 1024) {
        $("#FilterHolder").removeClass("bigMapFilter");
        $(".pullBigFil ").remove();
        $("#FilterHolder").removeAttr("style");
        $("#encyclopedia_beta_label").fadeIn();
        if ($(window).width() == 768) {
            $(".pullBigFil ").animate({left: "-20px"});
            $(".wrapperSelect").removeAttr("style")
            $(".pullBigFil ").removeClass("ipad768Width");
            $(".wrapperSelect").css("display", "inline-block");
            $("#mostNew").removeAttr("style");
        }
    } else {
        $("#encyclopedia_beta_label").fadeIn();
    }
}

